// declare some variables for properties shared by SMTP_REQUEST and SMTP_RESPONSE
var date = getTimestampMSec(),
    clientIP = Flow.client.ipaddr,
    serverIP = Flow.server.ipaddr,
    senderIP = Flow.sender.ipaddr,
    receiverIP = Flow.receiver.ipaddr,
    senderDomain = SMTP.domain,
    headers = JSON.stringify(SMTP.headers, null, 10),
    sender = SMTP.sender,
    recipient = SMTP.recipient,
    recipientList = SMTP.recipientList,
    isEncrypted = SMTP.isEncrypted,
    method = SMTP.method;

// for SMTP requests, debug stuff
if (event == 'SMTP_REQUEST') {

    debug('Saw an ' + event + ' at ' + date + '\n' +
          'Client IP: ' + clientIP + '\n' +
          'Server IP: ' + serverIP + '\n' +
          'Sender IP: ' + senderIP + '\n' +
          'Receiver IP: ' + receiverIP + '\n' +
          'Sender Domain: ' + senderDomain + '\n' +
          'SMTP Method: ' +  method + '\n' + 
          'is Encrypted?: ' + isEncrypted + '\n' + 
          'Message Headers: ' + headers + '\n' +
          'Sender: ' + sender + '\n' +
          'Recipient: ' + recipient + '\n' +
          'Recipient List: ' + recipientList
         );

}


// for SMTP responses, debug other stuff
else if (event == 'SMTP_RESPONSE') {

    //declare some variables for properties specific to SMTP_RESPONSE
    var statusCode = SMTP.statusCode,
        statusText = SMTP.statusText,
        error = SMTP.error;

    debug('Saw an ' + event + ' at ' + date + '\n' +
          'Client IP: ' + clientIP + '\n' +
          'Server IP: ' + serverIP + '\n' +
          'Sender IP: ' + senderIP + '\n' +
          'Receiver IP: ' + receiverIP + '\n' +
          'Sender Domain: ' + senderDomain + '\n' +
          'SMTP Method: ' +  method + '\n' +
          'is Encrypted?: ' + isEncrypted + '\n' +
          'Message Headers: ' + headers + '\n' +
          'Sender: ' + sender + '\n' +
          'Recipient: ' + recipient + '\n' +
          'Recipient List: ' + recipientList + '\n' +
          'Status Code: ' + statusCode + '\n' +
          'Status Text: ' + statusText + '\n' +
          'Error: ' + error
         );

}

//Lists of domains to check
var domainsToCheck = ["ornl.gov", "slac.stanford.edu", "kcp.com", "google.com"];

function getDomainName(hostName) {
    return hostName.substring(hostName.lastIndexOf(".", hostName.lastIndexOf(".") - 1) + 1);
}

debug("Method: " + SMTP.method + " Event: " + event + " Encrypted: " + SMTP.isEncrypted);

//Check to see if the SMTP method is available
if (SMTP.method) {
    //Capture the SMTP method in lower case
    var method = SMTP.method.toLowerCase();
    //Check to see if the message is EHLO or HELO
    if (method.indexOf('ehlo') > -1 || method.indexOf('helo') > -1) {
        //If this is a SMTP response
        if (event === 'SMTP_RESPONSE') {
            //If status text is not null
            if (SMTP.statusText) {
                //Capture the status text in lower case and grab the first line
                var statusText = SMTP.statusText.toLowerCase();
                var firstLine = statusText.split('\n')[0];
                //If the first line starts with 250
                if (firstLine.match(/^(250)/)) {
                    //Get the sserver name in the response
                    var smtpRecipient = firstLine.substring(4).split(" ")[0];
                    //Check to see if the domain matches 
                    debug("SMTP Recipient: " + smtpRecipient);
                    Flow.store.smtpRecipient = smtpRecipient;
                }
            }
        } else if (event === 'SMTP_REQUEST') {
            if (SMTP.domain) {
                var smtpDomain = SMTP.domain.toLowerCase();
                debug("SMTP Domain: " + smtpDomain);
                Flow.store.smtpDomain = smtpDomain;
            }
        }
    } else {
        if (event === 'SMTP_RESPONSE') {
            var smtpRecip = Flow.store.smtpRecipient;
            var smtpDom = Flow.store.smtpDomain;
            for (i = 0; i < domainsToCheck.length; i++) {
                if (smtpRecip.indexOf(domainsToCheck[i]) > -1 || smtpDom.indexOf(domainsToCheck[i]) > -1) {
                    debug("Else Method: " + SMTP.method);
                    if (SMTP.isEncrypted) {
                   //     Application("SMTP From " + getDomainName(smtpDom) + " To " + getDomainName(smtpRecip)).metricAddCount("encrypted_" + getDomainName(smtpRecip), 1);
                        debug("encrypted_" + smtpRecip);
                    } else {
                      //  Application("SMTP From " + getDomainName(smtpDom) + " To " + getDomainName(smtpRecip)).metricAddCount("unencrypted_" + getDomainName(smtpRecip), 1);
                        debug("unencrypted_" + smtpRecip);
                    }
                   // Application("SMTP From " + getDomainName(smtpDom) + " To " + getDomainName(smtpRecip)).commit();
                }
            }
        }
    }
}

var appname = "Microsoft Exchange"; 

if ( event == "FLOW_CLASSIFY" ) {
    // Gather L4 metrics
    Flow.setApplication(appname);
} else {
    // Gather L7 metrics (HTTP, DB, etc.)
    Application(appname).commit();
}

//Trigger used to browse headers
var hdr,
    headers = HTTP.headers, 
    i; 

//Label 'Response or Request' so you know whats what.
var text = event + "\n";

//Loop through headers and make them Human Readable
for (i = 0; i < headers.length; i++) { 
    hdr = headers[i]; 
    text = text + "headers[" + i + "].name: " + hdr.name + "\n";  
    text = text + "headers[" + i + "].value: " + hdr.value + "\n"; 
} 

debug(text);
